import { motion } from "framer-motion";
import AdviceCarousel from "../components/carousel";

const StarterKit = () => {
  const resources = [
    {
      title: "Getting Started Guide",
      description: "Essential tips and best practices for new freelancers.",
      type: "PDF Guide",
      icon: "üìö",
      color: "from-blue-500 to-blue-600",
    },
    {
      title: "Portfolio Templates",
      description: "Professional templates to showcase your work.",
      type: "Templates",
      icon: "üé®",
      color: "from-purple-500 to-purple-600",
    },
    {
      title: "Pricing Calculator",
      description: "Tool to help you set competitive rates.",
      type: "Tool",
      icon: "üí∞",
      color: "from-green-500 to-green-600",
    },
    {
      title: "Contract Templates",
      description: "Legal templates for client agreements.",
      type: "Documents",
      icon: "üìÑ",
      color: "from-red-500 to-red-600",
    },
  ];

  const additionalResources = [
    {
      title: "Marketing Guide",
      description: "Learn how to market your services effectively.",
      icon: "üì¢",
    },
    {
      title: "Client Communication Templates",
      description: "Professional email and message templates.",
      icon: "‚úâÔ∏è",
    },
    {
      title: "Tax Guide for Freelancers",
      description: "Essential tax information and tips.",
      icon: "üìä",
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.15 },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { type: "spring", stiffness: 120 },
    },
  };

  return (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      animate="visible"
      className="px-6 md:px-12 py-12 max-w-7xl mx-auto"
    >
      {/* Header */}
      <motion.div variants={itemVariants} className="text-center mb-16">
        <h1 className="text-4xl md:text-6xl font-extrabold mb-4 bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
          Freelancer Starter Kit
        </h1>
        <p className="text-lg md:text-xl text-gray-700 max-w-4xl mx-auto leading-relaxed">
          Essential resources and tools designed to jumpstart your freelancing career with confidence and professionalism.
        </p>
      </motion.div>

      {/* Highlight Banner */}
      <motion.div
        variants={itemVariants}
        className="bg-gradient-to-r from-purple-600 to-blue-600 rounded-xl p-6 mb-12 text-white text-center shadow-lg"
      >
        <p className="text-lg md:text-2xl font-semibold max-w-3xl mx-auto">
          Everything you need to get started ‚Äî from contracts and pricing calculators to marketing and invoicing templates.
        </p>
      </motion.div>

      {/* Main Resources */}
      <motion.div
        variants={containerVariants}
        className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-16"
      >
        {resources.map((resource, index) => (
          <motion.div
            key={index}
            variants={itemVariants}
            whileHover={{ scale: 1.03 }}
            className="bg-white rounded-2xl shadow-md hover:shadow-xl transition-shadow duration-300 overflow-hidden flex flex-col"
          >
            <div
              className={`p-6 bg-gradient-to-r ${resource.color} text-white flex justify-between items-center`}
            >
              <h2 className="text-2xl font-semibold leading-snug">{resource.title}</h2>
              <span className="text-4xl select-none">{resource.icon}</span>
            </div>
            <div className="p-6 flex flex-col flex-grow">
              <p className="text-gray-700 mb-6 flex-grow leading-relaxed">{resource.description}</p>
              <div className="flex items-center justify-between">
                <span className="bg-gray-100 text-gray-900 px-4 py-1 rounded-full text-sm font-medium tracking-wide select-none">
                  {resource.type}
                </span>
                <motion.button
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.95 }}
                  aria-label={`Download ${resource.title}`}
                  className="bg-gradient-to-r from-blue-600 to-purple-600 text-white px-5 py-2 rounded-lg font-semibold shadow-md hover:from-blue-700 hover:to-purple-700 transition-colors duration-300"
                >
                  Download
                </motion.button>
              </div>
            </div>
          </motion.div>
        ))}
      </motion.div>

      {/* Advice Carousel Section */}
      <AdviceCarousel />

      {/* Additional Resources */}
      <motion.div
        variants={itemVariants}
        className="mt-20 bg-gradient-to-r from-blue-600 to-purple-600 rounded-3xl p-10 text-white shadow-lg"
      >
        <h2 className="text-3xl font-bold mb-8 text-center">Additional Resources</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {additionalResources.map((resource, index) => (
            <motion.div
              key={index}
              whileHover={{ scale: 1.05 }}
              className="bg-white/10 backdrop-blur-sm rounded-xl p-6 flex flex-col items-center text-center cursor-default select-none"
            >
              <div className="text-5xl mb-5">{resource.icon}</div>
              <h3 className="text-xl font-semibold mb-3">{resource.title}</h3>
              <p className="text-white/80 leading-relaxed">{resource.description}</p>
            </motion.div>
          ))}
        </div>
      </motion.div>

      {/* CTA Footer */}
      <motion.div
        variants={itemVariants}
        className="mt-20 text-center"
      >
        <p className="text-gray-700 text-lg mb-6">
          Need personalized help or have questions about your freelancing journey?
        </p>
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          aria-label="Contact Support"
          className="bg-gradient-to-r from-blue-600 to-purple-600 text-white px-10 py-3 rounded-full font-semibold shadow-lg hover:from-blue-700 hover:to-purple-700 transition-colors duration-300"
        >
          Contact Support
        </motion.button>
      </motion.div>
    </motion.div>
  );
};

export default StarterKit;
